import itertools
import collections
import functools
import operator
class Solution:
    def countPairs(self, deliciousness: list()) -> int:
        res = 0
        deliciousness.sort()
        d = collections.Counter(deliciousness)
        for i, j in (itertools.combinations(d.keys(), 2)):
            t = i+j
            if (t & (t-1) == 0) and t != 0:
                res += d[i] * d[j]
        for s in d.keys():
            if (s*2 & (s*2-1) == 0) and s*2 != 0:
                numer = functools.reduce(operator.mul, range(d[s], d[s]-2, -1), 1)
                denom = functools.reduce(operator.mul, range(1, 2+1), 1)
                res += numer//denom
        return res
